import React, { useState } from "react";

const ItineraryForm = () => {
  const [itinerary, setItinerary] = useState([]);
  const [dayDetails, setDayDetails] = useState({
    day_no: "",
    highlights: "",
    activities: [],
    locations: []
  });
  const [activity, setActivity] = useState({
    activityName: "",
    description: "",
    time: "",
    location: ""
  });
  const [location, setLocation] = useState({
    name: "",
    address: "",
    description: ""
  });

  const handleDayChange = (e) => {
    setDayDetails({
      ...dayDetails,
      [e.target.name]: e.target.value
    });
  };

  const handleActivityChange = (e) => {
    setActivity({
      ...activity,
      [e.target.name]: e.target.value
    });
  };

  const handleLocationChange = (e) => {
    setLocation({
      ...location,
      [e.target.name]: e.target.value
    });
  };

  const addActivity = () => {
    setDayDetails((prevState) => ({
      ...prevState,
      activities: [...prevState.activities, activity]
    }));
    setActivity({
      activityName: "",
      description: "",
      time: "",
      location: ""
    });
  };

  const addLocation = () => {
    setDayDetails((prevState) => ({
      ...prevState,
      locations: [...prevState.locations, location]
    }));
    setLocation({
      name: "",
      address: "",
      description: ""
    });
  };

  const addDay = () => {
    setItinerary((prevState) => [...prevState, dayDetails]);
    setDayDetails({
      day_no: "",
      highlights: "",
      activities: [],
      locations: []
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Submitted Itinerary:", itinerary);
    // Replace with API call to send data
    // Example: axios.post("your_api_url", { itinerary }).then((response) => console.log(response));
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Create Itinerary</h2>
      <div>
        <label>Day Number:</label>
        <input
          type="number"
          name="day_no"
          value={dayDetails.day_no}
          onChange={handleDayChange}
          required
        />
      </div>
      <div>
        <label>Highlights:</label>
        <input
          type="text"
          name="highlights"
          value={dayDetails.highlights}
          onChange={handleDayChange}
          required
        />
      </div>
      <h3>Activities</h3>
      <div>
        <label>Activity Name:</label>
        <input
          type="text"
          name="activityName"
          value={activity.activityName}
          onChange={handleActivityChange}
          required
        />
      </div>
      <div>
        <label>Description:</label>
        <input
          type="text"
          name="description"
          value={activity.description}
          onChange={handleActivityChange}
          required
        />
      </div>
      <div>
        <label>Time:</label>
        <input
          type="text"
          name="time"
          value={activity.time}
          onChange={handleActivityChange}
          required
        />
      </div>
      <div>
        <label>Location:</label>
        <input
          type="text"
          name="location"
          value={activity.location}
          onChange={handleActivityChange}
          required
        />
      </div>
      <button type="button" onClick={addActivity}>
        Add Activity
      </button>
      <h3>Locations</h3>
      <div>
        <label>Location Name:</label>
        <input
          type="text"
          name="name"
          value={location.name}
          onChange={handleLocationChange}
          required
        />
      </div>
      <div>
        <label>Address:</label>
        <input
          type="text"
          name="address"
          value={location.address}
          onChange={handleLocationChange}
          required
        />
      </div>
      <div>
        <label>Description:</label>
        <input
          type="text"
          name="description"
          value={location.description}
          onChange={handleLocationChange}
          required
        />
      </div>
      <button type="button" onClick={addLocation}>
        Add Location
      </button>
      <button type="button" onClick={addDay}>
        Add Day
      </button>
      <button type="submit">Submit Itinerary</button>
    </form>
  );
};

export default ItineraryForm;
